import base64
import hashlib
import hmac
from hashlib import pbkdf2_hmac

def getToken(phone):
  signature = bytes.fromhex("")
  classes_dex_md5 = bytes.fromhex("e3295dd00987ac3b0ffda5e11a918f1f")
  password = bytes.fromhex("")
  salt = base64.b64decode("PkTwKSZqUfAUyR0rPQ8hYJ0wNsQQ3dW1+3SCnyTXIfEAxxS75FwkDf47wNv/c8pP3p0GXKR6OOQmhyERwx74fw1RYSU10I4r1gyBVDbRJ40pidjM41G1I1oN")
  iterations = 128
  dklen = 64

  key = pbkdf2_hmac("sha1", password, salt, iterations, dklen)
  mac = hmac.new(key=key, digestmod=hashlib.sha1)
  mac.update(signature)
  mac.update(classes_dex_md5)
  mac.update(phone.encode())
  return base64.b64encode(mac.digest())
